import React from 'react';
import Table from 'react-bootstrap/Table';
import {FaEdit, FaTrash} from 'react-icons/fa';


function List() {
  return (
    <div>
        <h1>List of Courses</h1>
        <table striped bordered hover variant="dark">
            <thead>
                <tr>
                    <th>Course Name</th>
                    <th>Description</th>

                </tr>
            </thead>
            <tbody>
                {
                <tr>
                    <td></td>
                    <td></td>
                    <td><FaEdit />  |

                                <button
                                    className="button"
                                >
                                    <FaTrash />
                                </button>

                            </td>
                </tr>
                }
            </tbody>
        </table>
    </div>
  );
}

export default Co;
